import React, { useState } from "react";
import { Button } from "carbon-components-react";
import Nav from "./nav.jsx";
import Tablas from "./tablas.jsx";
import "../../public/styles.css";

function Home() {
  const [orden, setOrden] = useState(<h1>Sin</h1>);

  const handleorden = () => {
    setOrden(<h1>Orden</h1>);
  };
  // function orden() {
  //   // alert('Hello!');
  //   // variable = true;
  // }
  function changeBackground(e) {
    e.target.style.background = "black";
    // variable = true;
  }
  function changeBackground2(e) {
    e.target.style.background = "#fff";
    // variable = false;
  }

  return (
    <div>
      <Nav />
      <div>{orden}</div>
      <Button onClick={handleorden}>Orden</Button>
      <Tablas />

      <br />
      <Button
        kind="ghost"
        onMouseOver={changeBackground}
        onMouseOut={changeBackground2}
      >
        Button
      </Button>
      <h1 className="colorR">soy h1</h1>
    </div>
  );
}

export default Home;
